import React, { useRef } from 'react';
import { useGLTF, useFrame } from '@react-three/drei';
import { Canvas, useThree } from '@react-three/fiber';
import * as THREE from 'three';

const Model = ({ ...props }) => {
  const group = useRef();
  const { nodes, materials } = useGLTF('/backgroundShapes.gltf');

  const lineMaterial = new THREE.LineBasicMaterial({
    color: 'black',
    linewidth: 1,
  });

  const faceMaterial = new THREE.MeshStandardMaterial({
    color: '#35BD8B',
    roughness: 0.5,
    metalness: 0.5,
  });

  const multiMaterial = new THREE.MeshStandardMaterial({
    wireframe: false,
    skinning: false,
    morphTargets: false,
    morphNormals: false,
    lights: true,
    ...faceMaterial,
  });

  multiMaterial.materials = [lineMaterial, faceMaterial];

  const outlineMaterial = new THREE.LineBasicMaterial({
    color: 'black',
    linewidth: 3,
    linejoin: 'round',
  });

  const outlineMesh = (geometry) => {
    const edges = new THREE.EdgesGeometry(geometry);
    const outline = new THREE.LineSegments(edges, outlineMaterial);
    outline.renderOrder = 1;
    return outline;
  };

  useFrame((state, delta) => {
    group.current.rotation.y += delta / 3;
  });

  return (
    <group ref={group} {...props}>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube.geometry}
        material={multiMaterial}
        position={[-1.59, 0.8, -0.09]}
        rotation={[-0.26, 0.43, 0.58]}
        scale={0.27}
      >
        {outlineMesh(nodes.Cube.geometry)}
      </mesh>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube001.geometry}
        material={materials['Material.003']}
        position={[1.68, 0.22, 0.51]}
        rotation={[0.14, -0.61, 0.24]}
        scale={0.26}
      >
        {outlineMesh(nodes.Cube001.geometry)}
      </mesh>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Roundcube.geometry}
        material={materials['Material.003']}
        position={[-0.67, -0.78, 0]}
        scale={0.28}
      >
        {outlineMesh(nodes.Roundcube.geometry)}
      </mesh>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube002.geometry}
        material={materials['Material.005']}
        position={[-0.96, -0.59, -0.72]}
        rotation={[-0.31, 0.09, 0.68]}
        scale={[0.63, 0.09, 0.11]}
      >
        {outlineMesh(nodes.Cube002.geometry)}
      </mesh>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube003.geometry}
        material={materials["Material.003"]}
        position={[-2.08, 0.7, -0.49]}
        rotation={[-0.27, 0.44, 0.58]}
        scale={0.27}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube004.geometry}
        material={materials["Material.005"]}
        position={[0.23, 0.5, -0.28]}
        rotation={[2.28, -0.63, 2.04]}
        scale={0.18}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube005.geometry}
        material={materials["Material.004"]}
        position={[0.4, 0.85, -0.12]}
        rotation={[2.28, -0.63, 2.04]}
        scale={0.18}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Roundcube001.geometry}
        material={materials["Material.004"]}
        position={[0.72, -0.35, 0]}
        scale={0.5}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Roundcube002.geometry}
        material={materials["Material.002"]}
        position={[0.6, -0.35, -1.04]}
        scale={0.6}
      />
    </group>
  );
}

useGLTF.preload(shapes);

export default function BackgroundShapes() {

    return <div style={{ zIndex: "-1", position: "fixed", height: "100dvh", width: "100dvw", border: "2px solid red", pointerEvents: "none" }}>
        <Canvas>
            <ambientLight />
            <pointLight position={[5, 5, 5]} />
            <Model />
        </Canvas>
    </div >
}
